// Project page
// Dynamically pick page from projectPages

import { useParams } from 'react-router-dom';
import {DatatonismPage, SpirPage, SteammindPage, SfbsPage} from './projects/export-projects';
import '../styles/projtemplate.css';
import projects from '../db.json'

const projectPages = {
    1: DatatonismPage,
    2: SpirPage,
    3: SteammindPage,
    4: SfbsPage,
};

export default function Test(props) {
    const { id } = useParams();
    const Page = projectPages[id];
    console.log(Page);
    <Route exact path="/portfolio/:id" render={({match}) => (
        <Project proj={projects.find(p => p.id === match.params.id)} />
    )} />
}

